import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <User
        id={user.name}
        pw={user.pw}
        name={user.name}
        p1={user.p1}
        p2={user.p2}
        p3={user.p3}
        email={user.email}
      />
    );
  }
}

export default App;
